*/

// @mui material components
import Container from "@mui/material/Container";
import Grid from "@mui/material/Grid";

// Material Kit 2 React components
import MKBox from "components/MKBox";
import MKAvatar from "components/MKAvatar";
import MKTypography from "components/MKTypography";

// Images
import profilePicture from "assets/images/pfp.png";

function Profile() {
  return (
    <MKBox component="section" py={{ xs: 6, sm: 12 }}>
      <Container>
        <Grid container item xs={12} justifyContent="center" mx="auto">
          <MKBox mt={{ xs: -16, md: -20 }} textAlign="center">
            <MKAvatar src={profilePicture} alt="Burce Mars" size="xxxl" shadow="xl" />
          </MKBox>
          <Grid container justifyContent="center" alignItems="center" py={6}>
            <Grid item xs={12} md={7} mx="auto">
              <MKTypography variant="h3" margin="0 0 1rem">
                Justin Wang
              </MKTypography>
              <MKTypography variant="body1" fontWeight="light" color="text">
                My software development journey is an ongoing process filled with continuous learning and a deep passion for artificial intelligence and web development.
              </MKTypography>
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </MKBox>
  );
}

export default Profile;
